import React from 'react';
import './App.css';
import Header from "./components/Header/Header";
import Sidebar from "./components/Sidebar/Sidebar";
import ContainerDiv from "./components/Container/Container";

function App() {
  return (
    <div className="App">
      <Header />
      <Sidebar />
      <ContainerDiv />
    </div>
  );
}

export default App;
